import Cat from './Cat';

function App() {
  const [pictures, setPictures] = useState([])

  fetch('https://aws.random.cat/meow')
    .then(res => {
      setPictures(res.text( ));
    });

  return (
    <>
      <Cat catPictureUrl={pictures} />
    </>
  );
}

export default App;
